import React from "react";
import { Component } from "react";

const stuff  = [
  {
  name: "Name",
  rank: 1,
  salary: 10000001,
  desc: "DESCRIPTION OF JOB WILL PROBABLY TAKE UP A LOT OF SPACE. DESCRIPTION OF JOB WILL PROBABLY TAKE UP A LOT OF SPACE.",
  jobs: ["JOB 1", "JOB 2", "JOB 3"]
  },
  {
  name: "Name 2",
  rank: 2,
  salary: 2020000,
  desc: "DESCRIPTION OF JOB WILL PROBABLY TAKE UP A LOT OF SPACE.",
  jobs: ["JOB 1", "JOB 2", "JOB 3"]
  },
  {
  name: "Name 3",
  rank: 124,
  salary: 12034,
  desc: "DESCRIPTION OF JOB WILL PROBABLY TAKE UP A LOT OF SPACE.",
  jobs: ["JOB 1", "JOB 2", "JOB 3"]
  }
]

class Job extends Component {

  expand = major => {
    console.log(major)
    let content = document.getElementById(major.name).nextElementSibling;
    if (content.style.display === "table-row") {
      content.style.display = "none";
    } else {
      content.style.display = "table-row";
    }
  }

render(){

let wrap = {
  width: "90vw",
  marginLeft: "auto",
  marginRight: "auto",
  height: "fit-content",
  borderCollapse: "collapse",
  borderColor: "#dcdcdc",

};

    return(
      <div>
      <table border="1" frame="void" rules="rows" style={wrap}>
        <colgroup>
         <col style={{width: "70%", minWidth: "70%"}}/>
         <col style={{width: "10%", minWidth: "10%"}}/>
         <col style={{width: "20%", minWidth: "20%"}}/>
        </colgroup>
        <tr style={{background: "white", textAlign: "left", padding: "2vw"}}>
          <th>Major</th>
          <th>Ranking</th>
          <th>Salary</th>
        </tr>
        <tbody>
          {stuff.map(major =>
          [
          <tr id={major.name} className="entry" onClick={() => this.expand(major)}>
           <td style={{color:"#3db6ff", fontWeight:"bold"}}>{major.name}</td>
           <td>{major.rank}</td>
           <td>${major.salary.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",")}</td>
          </tr>,
          <tr className="entryInfo">
            <td colspan="3"><div style={{color: "black", fontWeight:"bold", fontSize:"1.5vh"}}>DESCRIPTION</div>{major.desc}</td>
          </tr>
          ]
          )}
        </tbody>
      </table>
      </div>
    );
}

}

export default Job;
